import React from 'react';
import { Route } from "react-router-dom";
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import Avehicle from "./components/pages/Avehicle"

function App() {
  return (
    <div className="App">
     <Route path="/Avehicle" component={Avehicle} />
    </div>
  );
}

export default App;
